function SkillBar(props) {
    if (props.skill == null || props.progress == null) {
        return null
    }

    if (props.color == null) {
        props.color = `rgb(${Math.random() * 255}, ${Math.random() * 255}, ${Math.random() * 255})`
    }

    return(
        <div style={{width: '100%', paddingTop: '20px'}}>
            <h1 style={{marginTop: '20px'}}>{props.skill}</h1>
            <div>
                <div style={{backgroundColor:`${props.color}`, width: `${props.progress}%`, height: '20px', float: 'left'}}/>
                <div style={{backgroundColor:'gray', width: `${100 - props.progress}%`, height: '20px', float: 'left'}}/>
            </div>
        </div>
    )
}

export default SkillBar;
